import React from 'react';
import PropTypes from 'prop-types';


const Testa = (props) => {
  const { tit, name, mess, status } = props;
  return (
    <div className="taskItem">
      <label> Title {tit} </label><br></br>
      <label> Creator {name}</label><br></br>
      <label> Status {status}</label><br></br>
      <p>
        Desscription: {mess} <br />
      </p>
    </div>

  )
};
Testa.propTypes = {
  tit: PropTypes.string,
  name: PropTypes.string,
  status: PropTypes.string,
  mess: PropTypes.string,
}
Testa.defaultProps = {
  tit : "title 1",
  name : "name",
  status : "status 1",
  mess : "messs",
}



export default Testa;
